        super(props);
        this.state = {
          selectedGender: null,
          selectedLocation: null,
          selectedLetter: null,
        };
      }
      handleSelectGender = (selectedOption) => {
        this.setState({ selectedGender: selectedOption.value });
      };

      handleSelectLetter = (selectedOption) => {
